import React from 'react'
import styles from './Dialogs.module.css'


const DialogItem = ({name , message}) => {
  return(
      <section>
        <h1> {name} </h1>
        <p> {message} </p>
      </section>
  )}

export default function Dialogs() {
  return (
   <DialogItem name={'Sasha'} message={ 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Sunt, dolore' } />
  )
}
